eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"langArr\": () => (/* binding */ langArr)\n/* harmony export */ });\nconst langArr = {\r\n    //? root\r\n    \"title\" : {\r\n        \"ru\" : \"Татарские писатели XX века\",\r\n        \"tat\" : \"XX гасырнын татар язучылары\",\r\n        \"en\" : \"Tatar writers of XX century\",\r\n    },\r\n    \"root-title\" : {\r\n        \"ru\" : \"Татарские писатели XX века\",\r\n        \"tat\" : \"XX гасырнын татар язучылары\",\r\n        \"en\" : \"Tatar writers of XX century\",\r\n    },\r\n    \"root-subtitle\" : {\r\n        \"ru\" : \"Их жизнь и творчество\",\r\n        \"tat\" : \"Тормышлары hәм иҗатлары\",\r\n        \"en\" : \"Their lives and works\",\r\n    },\r\n    \"eniki-block\" : {\r\n        \"ru\" : \"Амирхан Еники\",\r\n        \"tat\" : \"Әмирхан Еники\",\r\n        \"en\" : \"Amirkhan Yeniki\",\r\n    },\r\n    \"yunis-block\" : {\r\n        \"ru\" : \"Миргазиян Юнусов\",\r\n        \"tat\" : \"Миргазиян Юныс\",\r\n        \"en\" : \"Mirgaziyan Yunusov\",\r\n    },\r\n    \"khasanov-block\" : {\r\n        \"ru\" : \"Махмут Хасанов\",\r\n        \"tat\" : \"Миргазиян Юныс\",\r\n        \"en\" : \"Makhmut Khasanov\",\r\n    },\r\n    \"sabitov-block\" : {\r\n        \"ru\" : \"Габдельхай Сабитов\",\r\n        \"tat\" : \"Габделхәй Сабитов\",\r\n        \"en\" : \"Gabdelkhai Sabitov\",\r\n    },\r\n    \"read\" : {\r\n        \"ru\" : \"Читать\",\r\n        \"tat\" : \"Укырга\",\r\n        \"en\" : \"Read\",\r\n    },\r\n    \"warning\" : {\r\n        \"ru\" : \"Данная веб-страница не доработана\",\r\n        \"tat\" : \"Бу веб-бит эшләнеп бетерелмәгән\",\r\n        \"en\" : \"This web page hasn't been finalized\",\r\n    },\r\n    //? all\r\n    \"about-title\" : {\r\n        \"ru\" : \"<i class='far fa-question-circle'></i>&nbsp;О писателе\",\r\n        \"tat\" : \"<i class='far fa-question-circle'></i>&nbsp;Язучы турында\",\r\n        \"en\" : \"<i class='far fa-question-circle'></i>&nbsp;About writer\",\r\n    },\r\n    \"texts\": {\r\n        \"ru\": \"<i class='fas fa-book'></i>&nbsp;Произведения\",\r\n        \"tat\": \"<i class='fas fa-book'></i>&nbsp;Әсәрләр\",\r\n        \"en\": \"<i class='fas fa-book'></i>&nbsp;Works\",\r\n    },\r\n    \"publicism\": {\r\n        \"ru\": \"<i class='fa-solid fa-newspaper'></i>&nbsp;Публицистика\",\r\n        \"tat\": \"<i class='fa-solid fa-newspaper'></i>&nbsp;Публицистика\",\r\n        \"en\": \"<i class='fa-solid fa-newspaper'></i>&nbsp;Publicism\",\r\n    },\r\n    \"gallery\": {\r\n        \"ru\": \"<i class='fas fa-image'></i>&nbsp;Галерея\",\r\n        \"tat\": \"<i class='fas fa-image'></i>&nbsp;Галерея\",\r\n        \"en\": \"<i class='fas fa-image'></i>&nbsp;Gallery\",\r\n    },\r\n    //? eniki\r\n    \"eniki-doctitle\" : {\r\n        \"ru\" : \"Амирхан Еники | Главная\",\r\n        \"tat\" : \"Әмирхан Еники | Баш\",\r\n        \"en\" : \"Amirkhan Yeniki | Main\",\r\n    },\r\n    \"eniki-title\" : {\r\n        \"ru\" : \"Амирхан<br>Еники\",\r\n        \"tat\" : \"Әмирхан<br>Еники\",\r\n        \"en\" : \"Amirkhan<br>Yeniki\",\r\n    },\r\n    \"eniki-subtitle\" : {\r\n        \"ru\" : \"Жизнь и творчество\",\r\n        \"tat\" : \"Тормыш hәм иҗат\",\r\n        \"en\" : \"Life and work\",\r\n    },\r\n    \"eniki-text-1\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Татарский народный писатель, публицист, лауреат Государственной премии РТ им. Г. Тукая <b>Амирхан Еники</b> <i>(1909-2000)</i> – выдающийся татарский писатель ХХ века. Он вошёл в историю татарской литературы как неповторимый в своей индивидуальности мастер-психолог, которого отличает глубокое проникновение во внутренний мир героев, подробное описание и анализ различных психологических состояний, внимание к оттенкам переживаний.`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Татар халык язучысы, публицист, ТР Г.Тукай исемендәге Дәүләт премиясе лауреаты <b>Әмирхан Еники</b><i>(1909-2000)</i> - ХХ гасырның күренекле татар язучысы. Ул татар әдәбияты тарихына үзенең шәхсилегендә кабатланмас мастер-психолог буларак кереп калды, аның геройларның эчке дөньясына тирән үтеп керүе, төрле психологик халәтләрне җентекләп тасвирлавы һәм анализы, кичерешләр төсмерләренә игътибары бар.`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Tatar People's writer, publicist, laureate of the State Prize of the Republic of Tatarstan named after G. Tukai <b>Amirkhan Yeniki</b> <i>(1909-2000)</i> – an outstanding Tatar writer of the twentieth century. He entered the history of Tatar literature as a master psychologist unique in his individuality, who is distinguished by a deep penetration into the inner world of the characters, a detailed description and analysis of various psychological states, attention to the shades of experiences.`,\r\n    },\r\n    \"eniki-text-2\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Вопрос психологизма в творчестве писателя представляется узловой проблемой и приобретает первостепенное значение для углубленного понимания его творческой индивидуальности.`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Язучы иҗатында психологизм мәсьәләсе - төенле проблема һәм аның иҗади индивидуальлеген тирәнтен аңлау өчен, беренче әһәмияткә ия.`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>The question of psychologism in the writer's work seems to be a nodal problem and becomes of paramount importance for an in-depth understanding of his creative individuality.`,\r\n    },\r\n    \"eniki-text-3\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span><i>А. Еники</i> – создатель убедительных образов, он сумел соединить в своем творчестве глубокий аналитический взгляд на современность и глубокий метафизический план.`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span><i>Ә. Еники</i> - ышандыргыч образлар булдыручы, ул үз иҗатында хәзерге заманга тирән аналитик карашын һәм тирән метафизик планны берләштерә алган.`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span><i>A. Eniki</i> is a creator of convincing images, he managed to combine in his work a deep analytical view of modernity and a deep metaphysical plan.`,\r\n    },\r\n    \"eniki-text-4\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>В рассказах военного времени А. Еники прозвучали нотки первых изменений в литературе, которые впоследствии окажут влияние и будут идентифицированы в татарской литературе второй половины ХХ в. Такие произведения писателя как «Бала» («Девочка», 1941), «Ана һәм кыз» («Мать и дочь», 1942), «Бер генә сәгатькә» («Лишь на час», 1944), «Ялгыз каз» («Одинокий гусак», 1944), «Мәк чәчәге» («Мак», 1944) отдельным течением выделялись в общем потоке военной литературе, детально описывающей ужасающие подробности фронтовой и тыловой реальности, примеры жестокого поведения врагов, подвиги трудового народа и военных. Прозаик обращает свой взор на жанровые вариации, развивавшиеся в татарской литературе, начала ХХ века, внося в свой творческий арсенал «прозу открытий», жанр <i>«нәсер»</i> (лирическая проза).`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>В рассказах военного времени А. Еники прозвучали нотки первых изменений в литературе, которые впоследствии окажут влияние и будут идентифицированы в татарской литературе второй половины ХХ в. Такие произведения писателя как «Бала» («Девочка», 1941), «Ана һәм кыз» («Мать и дочь», 1942), «Бер генә сәгатькә» («Лишь на час», 1944), «Ялгыз каз» («Одинокий гусак», 1944), «Мәк чәчәге» («Мак», 1944) отдельным течением выделялись в общем потоке военной литературе, детально описывающей ужасающие подробности фронтовой и тыловой реальности, примеры жестокого поведения врагов, подвиги трудового народа и военных. Прозаик обращает свой взор на жанровые вариации, развивавшиеся в татарской литературе, начала ХХ века, внося в свой творческий арсенал «прозу открытий», жанр <i>«нәсер»</i> (лирическая проза).`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>В рассказах военного времени А. Еники прозвучали нотки первых изменений в литературе, которые впоследствии окажут влияние и будут идентифицированы в татарской литературе второй половины ХХ в. Такие произведения писателя как «Бала» («Девочка», 1941), «Ана һәм кыз» («Мать и дочь», 1942), «Бер генә сәгатькә» («Лишь на час», 1944), «Ялгыз каз» («Одинокий гусак», 1944), «Мәк чәчәге» («Мак», 1944) отдельным течением выделялись в общем потоке военной литературе, детально описывающей ужасающие подробности фронтовой и тыловой реальности, примеры жестокого поведения врагов, подвиги трудового народа и военных. Прозаик обращает свой взор на жанровые вариации, развивавшиеся в татарской литературе, начала ХХ века, внося в свой творческий арсенал «прозу открытий», жанр <i>«нәсер»</i> (лирическая проза).`,\r\n    },\r\n    \"eniki-text-5\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Основанная на психологизме, «проза открытий» позволяет писателю быть очевидцем человеческих переживаний, их внутреннего развития, трансформации. В рамках непривычной для себя реальности со всей полнотой раскрывается глубина характера личности, определяются границы его великодушия, чувства сострадания; военные события, функционирующие в художественной реальности в качестве временного хронотопа действия, противопоставляются общечеловеческим ценностям, человечеству в целом.`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Основанная на психологизме, «проза открытий» позволяет писателю быть очевидцем человеческих переживаний, их внутреннего развития, трансформации. В рамках непривычной для себя реальности со всей полнотой раскрывается глубина характера личности, определяются границы его великодушия, чувства сострадания; военные события, функционирующие в художественной реальности в качестве временного хронотопа действия, противопоставляются общечеловеческим ценностям, человечеству в целом.`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Based on psychologism, the \"prose of discoveries\" allows the writer to be an eyewitness to human experiences, their inner development, transformation. Within the framework of an unusual reality, the depth of the personality's character is fully revealed, the boundaries of his generosity and feelings of compassion are determined; military events functioning in artistic reality as a temporary chronotope of action are opposed to universal values, humanity as a whole.`,\r\n    },\r\n    \"eniki-text-6\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Жанр <i>«нәсер»</i> обретает в творчестве А. Еники вторую жизнь, не теряя при этом преемственности с произведениями начала века – схожие методы усиления философского содержания символическими образами, эстетического и психологического влияния произведения с помощью гармонии звучания. Все эти методы-принципы художественного произведения вкупе с изображением окружающей реальности через призму дебрей человеческой психологии, окрепнув, получат последующее развитие в татарской литературе 1960-80-х гг.`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Жанр <i>«нәсер»</i> обретает в творчестве А. Еники вторую жизнь, не теряя при этом преемственности с произведениями начала века – схожие методы усиления философского содержания символическими образами, эстетического и психологического влияния произведения с помощью гармонии звучания. Все эти методы-принципы художественного произведения вкупе с изображением окружающей реальности через призму дебрей человеческой психологии, окрепнув, получат последующее развитие в татарской литературе 1960-80-х гг.`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Genre <i>\"naser\"</i> finds a second life in the work of A. Eniki, without losing continuity with the works of the beginning of the century – similar methods of strengthening the philosophical content with symbolic images, aesthetic and psychological influence of the work with the help of harmony of sound. All these methods-the principles of a work of art, coupled with the image of the surrounding reality through the prism of the wilds of human psychology, having become stronger, will receive further development in the Tatar literature of the 1960s-80s.`,\r\n    },\r\n    \"eniki-text-7\": {\r\n        \"ru\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Творчество А. Еники выделяется наличием системообразующей тематически-идейной цепочки <i>\"цивилизация, человечество – нация – отдельная личность\"</i>. В рассказах, воплощающих картину философии бытия, смысла существования в творческом синтезе соединяются образы-понятия смерти, безнадежности, потери жизненных ценностей и различные группы образов-символов. Рассказы А. Еники логически синонимичны использованием в них речи повествователя в качестве способа выражения авторской позиции. Философия бытия, обрамленная в вариативные психологические описания, принимает оттенки национального. Автор, воссоздавая в художественном пространстве произведения переживания реального читателя, связанные с художественным воплощением конфликта оппозиций жизни и смерти, основывается на национальную модель философии бытия.`,\r\n        \"tat\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>Творчество А. Еники выделяется наличием системообразующей тематически-идейной цепочки <i>\"цивилизация, человечество – нация – отдельная личность\"</i>. В рассказах, воплощающих картину философии бытия, смысла существования в творческом синтезе соединяются образы-понятия смерти, безнадежности, потери жизненных ценностей и различные группы образов-символов. Рассказы А. Еники логически синонимичны использованием в них речи повествователя в качестве способа выражения авторской позиции. Философия бытия, обрамленная в вариативные психологические описания, принимает оттенки национального. Автор, воссоздавая в художественном пространстве произведения переживания реального читателя, связанные с художественным воплощением конфликта оппозиций жизни и смерти, основывается на национальную модель философии бытия.`,\r\n        \"en\": `<span class=\"noselect\">&#9658;&nbsp;&nbsp;&nbsp;</span>The creativity of A. Eniki is distinguished by the presence of a system-forming thematic and ideological chain <i>\"civilization, humanity – nation – individual\"</i>. In the stories embodying the picture of the philosophy of being, the meaning of existence, images-concepts of death, hopelessness, loss of vital values and various groups of images-symbols are combined in a creative synthesis. A. Eniki's stories are logically synonymous with the use of the narrator's speech in them as a way of expressing the author's position. The philosophy of being framed in variable psychological descriptions takes on shades of national. The author, recreating in the artistic space of the work the experiences of a real reader associated with the artistic embodiment of the conflict of oppositions of life and death, is based on the national model of the philosophy of being.`,\r\n    },\r\n    \"eniki-link\": {\r\n        \"ru\": `<i class=\"fa-solid fa-link\"></i><span class=\"noselect\">&nbsp;&nbsp;&nbsp;</span>Читать произведения А. Еники`,\r\n        \"tat\": `<i class=\"fa-solid fa-link\"></i><span class=\"noselect\">&nbsp;&nbsp;&nbsp;</span>Ә. Еникиның әсәрләрен укырга`,\r\n        \"en\": `<i class=\"fa-solid fa-link\"></i><span class=\"noselect\">&nbsp;&nbsp;&nbsp;</span>Read the works of A. Eniki`,\r\n    },\r\n    \"eniki-download\": {\r\n        \"ru\": `<i class=\"fa-solid fa-download\"></i><span class=\"noselect\">&nbsp;&nbsp;&nbsp;</span>Скачать сборник публицистических рассказов А. Еники`,\r\n        \"tat\": `<i class=\"fa-solid fa-download\"></i><span class=\"noselect\">&nbsp;&nbsp;&nbsp;</span>Ә. Еникиның публицистик хикәяләр җыентыгын яларга`,\r\n        \"en\": `<i class=\"fa-solid fa-download\"></i><span class=\"noselect\">&nbsp;&nbsp;&nbsp;</span>Download the collection of publicistic stories by A. Eniki`,\r\n    },\r\n    //? yunis\r\n    \"yunis-doctitle\": {\r\n        \"ru\": \"Миргазиян Юнусов\",\r\n        \"tat\": \"Миргазиян Юныс\",\r\n        \"en\": \"Mirgaziyan Yunusov\",\r\n    },\r\n    \"yunis-title\": {\r\n        \"ru\": \"Миргазиян<br>Юнусов\",\r\n        \"tat\": \"Миргазиян<br>Юныс\",\r\n        \"en\": \"Mirgaziyan<br>Yunusov\",\r\n    },\r\n    \"yunis-subtitle\": {\r\n        \"ru\": \"Жизнь и творчество\",\r\n        \"tat\" : \"Тормыш hәм иҗат\",\r\n        \"en\" : \"Life and work\",\r\n    },\r\n    \"yunis-text-1\": {\r\n        \"ru\": `►&nbsp;&nbsp;&nbsp;Известный писатель-прозаик, публицист, скульптор Миргазиян Юнус (Миргазиян Мухаметзакирович Юнусов) родился 25 мая 1927 года в деревне Исергапово Бавлинского района Татарстана в крестьянской семье. Юность Миргазияна приходится на довоенные и военные годы.`,\r\n        \"tat\": `►&nbsp;&nbsp;&nbsp;Күренекле язучы-прозаик, публицист, сынчы Миргазиян Юныс (Миргазиян Мөхәммәтзакир улы Юнысов) 1927 елның 25 маенда Татарстанның Баулы районы Исергәп авылында крестиян гаиләсендә туа. Миргазиянның бала һәм үсмерчагы сугышка кадәрге һәм сугыш барган авыр елларга туры килә.`,\r\n        \"en\": `►&nbsp;&nbsp;&nbsp;The famous novelist, publicist, sculptor Mirgaziyan Yunus (Mirgaziyan Mukhametzakirovich Yunusov) was born on May 25, 1927 in the village of Isergapovo in the Bavli district of Tatarstan in a peasant family. Mirgaziyan's youth falls on the pre-war and war years.`,\r\n    },\r\n    \"yunis-text-2\": {\r\n        \"ru\": `►&nbsp;&nbsp;&nbsp;На следующий день после начала войны, 23 июня 1941 года, умер его отец - ветеран Гражданской войны Мухаметзакир Юнусов. В этом году окончивший 6 класс сельской школы Миргазиян вынужден был бросить учебу в школе и начать работу на колхозе. В августе 1944 года он был призван на службу в военную авиационную школу, затем служил в эскадрилье бомбардировщиков на должности стрелка-радиста.`,\r\n        \"tat\": `►&nbsp;&nbsp;&nbsp;Сугыш башланган көннең икенче көнендә, 1941 елның 23 июнендә, аның әтисе - Гражданнар сугышы ветераны Мөхәммәтзакир абзый гүр иясе була. Шул елны авыл мәктәбенең алтынчы сыйныфын тәмамлаган Миргазиян, ары таба мәктәптә укуын ташларга мәҗбүр булып, колхоз эшенә җигелә. 1944 елның августында исә ул гаскәри хезмәткә алынып, хәрби авиация мәктәбенә укырга җибәрелә, аннары укчы-радист вазифасында бомбардировщиклар эскадрильясында хезмәт итә.`,\r\n        \"en\": `►&nbsp;&nbsp;&nbsp;The day after the start of the war, on June 23, 1941, his father, a Civil War veteran Mukhametzakir Yunusov, died. This year, Mirgaziyan, who graduated from the 6th grade of a rural school, had to drop out of school and start working on a collective farm. In August 1944, he was called up to serve in a military aviation school, then served in a bomber squadron as a radio operator.`,\r\n    },\r\n    \"yunis-text-3\": {\r\n        \"ru\": `►&nbsp;&nbsp;&nbsp;В 1950 году по окончании Харьковского военного авиационного училища в экстерном порядке занимал должность начальника отдела связи в авиаэскадрильях. Одновременно учился в вечерней школе и получил общее среднее образование.`,\r\n        \"tat\": `►&nbsp;&nbsp;&nbsp;1950 елда экстерн тәртибендә Харьков хәрби авиация училищесын тәмамлагач, авиаэскадрильяларда элемтә бүлеге башлыгы вазифаларын башкара. Бер үк вакытта кичке мәктәптә укып, гомуми урта белем ала.`,\r\n        \"en\": `►&nbsp;&nbsp;&nbsp;In 1950, after graduating from the Kharkov Military Aviation School, he held the position of head of the communications department in the air squadrons. At the same time, he studied at an evening school and received a general secondary education.`,\r\n    },\r\n\r\n    //? khasanov\r\n\r\n    //? sabitov\r\n\r\n    //? footer\r\n    \"footer\" : {\r\n        \"ru\" : \"Контакты\",\r\n        \"tat\" : \"Контактлар\",\r\n        \"en\" : \"Contacts\",\r\n    },\r\n}\n\n//# sourceURL=webpack://buby-medrese/./src/js/lang.js?");

